\[
S = a \frac{r^{n+1} - 1}{r - 1}
\]

In this case, the first term \(a\) is 1, the common ratio \(r\) is 3, and the number of terms \(n+1\) is 8. Therefore, the sum of the divisors is:

\[
S = 1 \cdot \frac{3^8 - 1}{3 - 1} = \frac{3^8 - 1}{2}
\]

We know that \(3^7 = 2187\), so \(3^8 = 3 \cdot 2187 = 6561\). Substituting this value into the sum formula, we get:

\[
S = \frac{6561 - 1}{2} = \frac{6560}{2} = 3280
\]

